general:
  stop_time: 1100s
  model_unblocked_syscall_latency: true

network:
  graph:
    type: 1_gbit_switch

hosts:
  bootstrap:
    network_node_id: 0
    ip_addr: 11.0.0.1
    processes:
    - path: /usr/local/app/eon-client/eon-client
      args: |
        --stdout --log-level info --bootstrap-mode --secret-key-seed 1 --script
        "[!Wait {time: 1100s}]"
      expected_final_state: running

  object-provider:
    network_node_id: 0
    processes:
    - path: /usr/local/app/eon-client/eon-client
      args: |
        --stdout --log-level info --bootstrap-addr 11.0.0.1 --secret-key-seed 12 --script 
        "[!Publish {path: /usr/local/app/test.txt}, !Wait {time: 70s}]"
      expected_final_state: running
      start_time: 1030s

  object-consumer:
    network_node_id: 0
    processes:
    - path: /usr/local/app/eon-client/eon-client
      args: |
        --stdout --log-level info --bootstrap-addr 11.0.0.1 --script
        "[!Get {id: "tfu/bZlxQcGmmf/CqI23mYdDunY90GVF8MVjXNnOVtc="}, !Wait {time: 40s}]"
      expected_final_state: running
      start_time: 1060s

  node0: &node
    network_node_id: 0
    processes:
